import React, { Component } from 'react';

export default class Box extends Component {
    state = {
        isCategory: false,
    };

    renderBox() {
        const { isCategory, value } = this.props;
        if (isCategory) {
            return <li>{this.props.category}</li>;
        } else {
            return <li>{value}</li>;
        }
    }

    render() {
        return this.renderBox();
    }
}
